import img from '../../../images/coupon/gay.jpg'

function Popular_spot_list(){
    return(
        <div className="wrap">
            <div>
                <img src={img}></img>
                <div className="info">
                    <p className="title">거개 아름</p>
                    <p>OO전문점</p>
                    <p>534m/9999 ~ 99,999원</p>
                </div>
            </div>
        </div>
    )
}

export default Popular_spot_list;
